  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!46986!';
  l_varchar2(2) :=q'!126186005838120739305646257205351809230!';
  l_clob(3) :=q'!BRYCE.COWLEY@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!31.07.2018 01:01:33.778879000 +00:00!';
  l_clob(5) :=q'!15256979510217!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
