  l_clob t_clob;
  type   t_varchar2 is table of varchar2(64) index by binary_integer;
  l_varchar2 t_varchar2;
begin

  l_varchar2(1) :=q'!49028!';
  l_varchar2(2) :=q'!148197801573262838882737096238151022968!';
  l_clob(3) :=q'!JOANNE.MCHENRY@MIDDLEMORE.CO.NZ!';
  l_varchar2(4) :=q'!13.08.2018 02:05:07.238956000 +00:00!';
  l_clob(5) :=q'!105611272792237!';

  insert into ASSETS.EBA_PROJ_STATUS_CLICKS
  (
     ID
